import React from 'react';
import Head from 'next/head'
import { withRouter } from 'next/router';
import styled from 'styled-components';
import {
  layout,
  space,
  color,
  typography,
  display,
  grid,
  flexbox,
  background,
  border,
  position,
} from 'styled-system'

import Nav from '../components/Nav'

const PageWrapper = styled.div`

`;

const PageHeader = styled.div(
  {
    boxSizing: 'border-box',
  },
  color,
  layout,
  space,
  display,
  flexbox,
);

const PageTitle = styled.h1(
  {},
  typography,
  color,
  space,
);

const PageContent = styled.div(
  {
    boxSizing: 'border-box',
  },
  space,
);

const PageSubtitle = styled.h3(
  {},
  typography,
  color,
  space,
);

const Onboard = ({}) => (
  <PageWrapper>
    <Head>
      <title>
        Upload your menu | OurMenu
      </title>
    </Head>
    <Nav transparent/>
    <PageHeader
      width="100vw"
      minHeight="50vh"
      bg="blue"
      color="black"
      pt="128px"
      pl={['16px', '24px', '56px']}
      pr={['16px', '24px', '56px']}
      pb={['16px', '24px', '56px']}
      display="flex"
      alignItems="center"
    >
      <PageTitle
        fontSize="4.5rem"
        fontWeight="bold"
        lineHeight="5rem"
        color="white"
        m="0"
      >
        We'll do all the hard stuff.
        <br/>
        You sit back and relax.
      </PageTitle>
    </PageHeader>
  </PageWrapper>
);

export default Onboard;
